import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMale, faFemale, faBirthdayCake } from '@fortawesome/free-solid-svg-icons'

function MemberRow(props) {
    const { member } = props;

      myChangeHandler = (event) => {
        console.log(event)
    }
    return (
        <tr onClick={this.myChangeHandler}>
            <td> 
                {/* <Link to={`/members/${member.id}`}> */}
                <i>{ member.gender==='MALE' ?  <FontAwesomeIcon icon={faMale} /> : <FontAwesomeIcon icon={faFemale} />}</i>
                <span>{member.nickName}</span>
                {/* </Link> */}
            </td>
            <td>{member.firstName}</td>
            <td>{member.lastName}</td>
            <td>{member.dateOfBirth ? member.dateOfBirth : 'NA'}</td>
        </tr>
    )
}

export default MemberRow;
